import { Injectable } from '@angular/core';
import { Recipe } from './recipe.model';

@Injectable({
  providedIn: 'root'
})
export class RecipesService {
  private recipes: Recipe[] = [
    {
      id: 'r1',
      title: 'Gado-gado',
      imageUrl:
      'https://www.bbcgoodfood.com/sites/default/files/styles/recipe/public/recipe/recipe-image/2016/05/gado-gado-salad.jpg?itok=MTTSriC8',
      ingredients: ['Lontong', 'Sawi', 'Bumbu Kecap', 'Tauge']
    },
    {
      id: 'r2',
      title: 'Ketupat',
      imageUrl:
      'data:image/jpeg;base64,',
      ingredients: ['Lontong', 'Sayur', 'Daging', 'Telor']
    },
    {
      id: 'r3',
      title: 'Pizza Margerita',
      imageUrl:
      'data:image/jpeg;base64,',
      ingredients: ['Roti', 'Margerita', 'Saus']
    },
  ];

  constructor() { }

  getAllRecipes(){
    return [...this.recipes];
  }

  getRecipe(recipeId: string){
    for(let i=0;i<this.recipes.length;i++) {
      if(this.recipes[i].id === recipeId){
        return this.recipes[i];
      }
    }
  }

  deleteRecipe(recipeId: string){
    for(let i = 0; i < this.recipes.length; i++) {
      if(this.recipes[i].id === recipeId){
        this.recipes.splice(i, 1);
        return this.recipes;
      }
    }
  }
}
